import React from "react";
import "../../App.js";
export default function About() {
  return (
    <React.Fragment>
      <h1 className="about">
        {" "}
        <div class="aboutme">
          <p>
          Nailed It! is an application created for users to leave reviews for nail techinicans within the DMV, 
          specifically in the Tysons Corner area. Here, users log into their account and find their nail
          tech to leave a review based on their service. Nail Techs who would like to be featured on our app can
          contact us, then we will list your profile. 
          Team members: 
          Kyle Barrand
          Danielle Latortue
          Kokhob Yohannes
          Maryam Tahir
          Duc Dinh
          </p>
        </div>
      </h1>
    </React.Fragment>
  );
}
